import {Chart} from 'chart.js';

const PieGraph = () => {
    var xPieValues=["Tired,"];
    var barColors = ["#b91d47","e8c3b9"]
    new Chart("PieChartDay", {
        type: "pie",
        data: {
            labels: xPieValues,
            datasets: [{
            backgroundColor: barColors,
            data: [55, 49]
            }]
        },
        options: {
            title: {
            display: true,
            }
        }
        });

    return (<canvas id="PieChartWeek" style="width:100%;"></canvas>);
}

export default PieGraph;
